import { useEffect, useState } from "react";

export default function Properties() {
  const [properties, setProperties] = useState([]);
  const [filtered, setFiltered] = useState([]);

  const [search, setSearch] = useState("");
  const [bhk, setBhk] = useState("");
  const [type, setType] = useState("");
  const [city, setCity] = useState("");
  const [price, setPrice] = useState(0);

  useEffect(() => {
    fetch("https://fake-realestate-50.vercel.app/properties")
      .then(res => res.json())
      .then(data => {
        setProperties(data);
        setFiltered(data);
      });
  }, []);

  // Filter Function
  useEffect(() => {
    let result = properties;

    if (search)
      result = result.filter((p) =>
        p.title.toLowerCase().includes(search.toLowerCase())
      );

    if (bhk) result = result.filter((p) => p.bhk == bhk);

    if (type) result = result.filter((p) => p.status === type);

    if (city)
      result = result.filter((p) =>
        p.location.toLowerCase().includes(city.toLowerCase())
      );

    if (price > 0)
      result = result.filter((p) => Number(p.price.replace(/\D/g, "")) <= price);

    setFiltered(result);
  }, [search, bhk, type, city, price, properties]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Search & Filters</h2>

      {/* Filters Section */}
      <div className="grid grid-cols-1 md:grid-cols-5 gap-4 mb-6">

        <input
          type="text"
          placeholder="Search title..."
          className="p-2 border rounded"
          onChange={(e) => setSearch(e.target.value)}
        />

        <select className="p-2 border rounded" onChange={(e) => setBhk(e.target.value)}>
          <option value="">BHK</option>
          <option value="1">1 BHK</option>
          <option value="2">2 BHK</option>
          <option value="3">3 BHK</option>
          <option value="4">4+ BHK</option>
        </select>

        <select className="p-2 border rounded" onChange={(e) => setType(e.target.value)}>
          <option value="">Buy/Rent</option>
          <option value="For Sale">For Sale</option>
          <option value="For Rent">For Rent</option>
        </select>

        <input
          type="text"
          placeholder="Enter City"
          className="p-2 border rounded"
          onChange={(e) => setCity(e.target.value)}
        />

        <input
          type="number"
          placeholder="Max Price"
          className="p-2 border rounded"
          onChange={(e) => setPrice(e.target.value)}
        />
      </div>

      {/* Results */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {filtered.length > 0 ? (
          filtered.map((item) => (
            <div key={item.id} className="border shadow rounded p-4 hover:scale-105 transition">
              <img src={item.image} alt={item.title} className="w-full h-48 object-cover rounded" />
              <h3 className="font-bold text-lg mt-3">{item.title}</h3>
              <p>üè° {item.bhk} BHK | {item.type}</p>
              <p>üìç {item.location}</p>
              <p className="text-green-600 font-bold">‚Çπ {item.price}</p>
              <button className="mt-3 w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700">
                View Details
              </button>
            </div>
          ))
        ) : (
          <h3 className="text-center col-span-3 text-gray-500 text-xl">
            No Results Found üòï
          </h3>
        )}
      </div>
    </div>
  );
}
